import "./App.css";

//let 은 값이 변할 수 있는 변수, const 는 한번 값을 대입하면 변경이 불가능한 상수 
//const 변수 = function(){} ECMA6 이전 Style 
const TableBox = () => { //UI 컴포넌트 용도는 첫글자를 대문자로 사용한다 
  return (
    <div className="tableBox">
        <table border="1">
          <tr>
            <th colSpan="3">테이블 연습</th>
          </tr>
          <tr>
            <td>seq</td>
            <td>name</td>
            <td>price</td>
          </tr>
          <tr>
            <td>1</td>
            <td>apple</td>
            <td>2000</td>
          </tr>
        </table>
      </div>
  );
};  

function App() { //reactApp 의 시작점 = Main 
  return (
    <div className="container">
      TableBox
      <div className="ulBox">
        <ul>
          <li>Java</li>
          <li>Python</li>
          <li>NodeJs</li>
        </ul>
      </div>
    </div>
  );
}

export default App;
